    <NavLink end style={({isActive})=>({color:isActive?'#9f0013':'inherit',backgroundColor:'#E0E5FF'})}  to={`/FoodList`}>
      <button>search</button>
          {/* <button onClick={()=>{setValue()}} className={!value?'active Navbar__Search':'Navbar__Search'}><SearchIcon sx={{ color: grey[900] }} /></button> */}
