       <button>favorites</button> {/* <button onClick={()=>{setValue(1)}} className={value?'active Navbar__Search':'Navbar__Search'}><FavoriteBorderIcon sx={{ color: grey[900] }} /></button> */}
    </NavLink>
        
    </Grid>
  </div>
  )
}
export default FoodHeader;
